import React from 'react';
import './Login.css';
import { Link, useHistory } from 'react-router-dom';

function Login() {
    return(
        <div className="Login">
          <Link to="/">
            <img 
              className="Login__"
              src=""
              alt=""
              />
          </Link>
        </div>
    );
}
 export default Login;
